package com.jty.model;import java.io.Serializable;import javax.persistence.Entity;import javax.persistence.Id;@SuppressWarnings("serial")@Entity(name = "userCar")public class UserCar implements Serializable {    @Id	private Integer id;    private Integer userId;    private String carNum;    private String vehicleLicence;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getUserId() {		return userId;	}	public void setUserId(Integer userId) {		this.userId = userId;	}	public String getCarNum() {		return carNum;	}	public void setCarNum(String carNum) {		this.carNum = carNum;	}	public String getVehicleLicence() {		return vehicleLicence;	}	public void setVehicleLicence(String vehicleLicence) {		this.vehicleLicence = vehicleLicence;	}    }